// User.ts
export class User {
  userId: number;
  userName: string;
  password: string;
  active: boolean;
  recycleBin: boolean;
  activeUntil: string;
  dateCreation: string;
  roleId: number;
  nom: string;
  prenom: string;
  mobile: string;
  email: string;

  constructor() {
    this.userId = 0; // Initialize to a default value or leave as undefined/null
    this.userName = '';
    this.password = '';
    this.active = true; // Default value for checkboxes
    this.recycleBin = false; // Default value for checkboxes
    this.activeUntil = new Date(); // Default value for date fields
    this.dateCreation = new Date(); // Default value for date fields
    this.roleId = 0; // Initialize to a default value or leave as undefined/null
    this.nom = '';
    this.prenom = '';
    this.mobile = '';
    this.email = '';
  }
}
